package com.playarea;

import java.util.Collections;
import java.util.HashMap;
import java.util.Map;

/**
 * @author chandrashekharv Circular Substring Competition 
 * 			
 * 		   Each year there is a huge contest organized in your town. People
 *         there are obsessed by crosswords and other letter and language
 *         related games.
 * 
 * 
 * 
 *         A traditional competition is: for two given words source and target,
 *         find the shortest substring of source such that it contains all the
 *         letters needed to construct target. However, since people became
 *         quite good in that, this year organizers decided to enhance the
 *         competition. The goal now is to find the shortest circular substring
 *         of the source, such that it contains all the letters needed to
 *         construct the target. For clarification, they added the following
 *         note to the rules:
 * 
 * 
 * 
 *         A circular substring of a string of length n is any segments of at
 *         most n consecutively neighboring letters in the string considering
 *         the fact that the right neighbor of the last letter is the first
 *         letter. For example, if the string is "hackerrank", circular
 *         substrings can be obtained from "ackerrankh", "ckerrankha",
 *         "kerrankhac" and so on. The words "rankhack" and "ack" are valid
 *         circular substrings of this string.
 * 
 * 
 * 
 *         As an example, assume source = melody and target = ldym. In its
 *         current form, source[0:5], length = 6 contains all of the letters in
 *         target. If we rotate source so that source' = elodym we see that
 *         source'[1:5] contains all the characters of target. Since no shorter
 *         substring can be found, we choose the shortest substring length of 5
 *         as the answer. If there had been no answer, we would have returned
 *         -1.
 * 
 * 
 * 
 *         As a programmer, you realized that you can use your skills to solve
 *         it faster than by hand. Write a function that helps you win the
 *         competition.
 * 
 * 
 * 
 * 
 * 
 *         Function Description
 * 
 *         Complete the function circularSubstringCompetition in the editor
 *         below. The function must return an integer denoting the shortest
 *         circular substring of word source that contains all the letters
 *         needed to build the word target. If no such substring exists, the
 *         function must return -1.
 * 
 * 
 * 
 *         circularSubstringCompetition has the following parameter(s):
 * 
 *         target: a string, the target word
 * 
 *         source: a string, the source word
 * 
 * 
 * 
 *         Constraints
 * 
 *         1 ≤ |target| ≤ 104 1 ≤ |source| ≤ 106 All letters in both strings are
 *         English lowercase letters ascii[a-z].
 * 
 * 
 *         Input Format for Custom Testing Input from stdin will be processed as
 *         follows and passed to the function.
 * 
 * 
 * 
 *         The first line contains a string target.
 * 
 *         The second line contains a string source.
 * 
 *         Sample Case 0 Sample Input 0
 * 
 *         krr hackerrank Sample Output 0
 * 
 *         4 Explanation 0
 * 
 *         target = "krr" and source = "hackerrank". The shortest circular
 *         substring of source that contains all the letters needed to build
 *         target is "kerr", so the answer is 4.
 * 
 *         Sample Case 1 Sample Input 1
 * 
 *         abc aabb Sample Output 1
 * 
 *         -1 Explanation 1
 * 
 *         target = "abc" and source = "aabb". The answer is -1 as no circular
 *         substring of source contains all the letters needed to build target.
 * 
 *         Sample Case 2 Sample Input 2
 * 
 *         kanah hackerrank Sample Output 2
 * 
 *         5 Explanation 2
 * 
 *         target = "kanah" and source = "hackerrank". The shortest circular
 *         substring of source that contains all the letters needed to build
 *         target is "ankha", so the answer is 5.
 *
 */
public class CircularStringCompetition {

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		String source = "";
		String target = "";

		int t[][] = new int[target.length()][source.length()];

		Map<Character, Integer> charMap = new HashMap<>();
		for (int i = 0; i < target.length(); i++) {
			charMap.compute(target.charAt(i), (k, v) -> v == null ? 1 : v + 1);
			boolean charExists = false;
			for (int j = 0; j < source.length(); j++) {
				if (target.charAt(i) == source.charAt(j) || (i - 1 >= 0 && t[i - 1][j] == 1)) {
					t[i][j] = 1;
					if (target.charAt(i) == source.charAt(j))
						charExists = true;
				} else
					t[i][j] = 0;

			}
			if (!charExists) {
				System.out.println("Can not form substring");
				return;

			}

		}
		Collections.unmodifiableMap(charMap);
		for (int i = 0; i < target.length(); i++) {
			for (int j = 0; j < source.length(); j++) {
				System.out.print(t[i][j]);
			}
			System.out.println();
		}

		int[] result = new int[source.length() * 2 - 1];
		System.arraycopy(t[target.length() - 1], 0, result, 0, source.length());
		System.arraycopy(t[target.length() - 1], 0, result, source.length(), source.length() - 1);
		for (int i = 0; i < result.length; i++) {
			System.out.print(result[i]);
		}

		int minLength = 0;
		int prevLength = Integer.MAX_VALUE;
		int count = 0;
		boolean sourceLength = false;
		Map<Character, Integer> cloneMap = new HashMap<>(charMap);
		for (int i = 0; i <= result.length - target.length();) {
			if (result[i] == 0 && minLength == 0) {
				i++;
				continue;
			} else {
				minLength += 1;
				if (result[i] == 0) {
					i++;
					continue;
				}

				if (i >= source.length()) {
					i = i - source.length();
					sourceLength = true;
				}

				if (targetContains(cloneMap, source.charAt(i)))
					count++;
				if (count == target.length() || minLength >= prevLength) {
					prevLength = minLength > prevLength ? prevLength : minLength;
					if (minLength <= prevLength)
						i = i - minLength + 2;
					if (sourceLength)
						i += source.length();

					minLength = 0;
					cloneMap = new HashMap<>(charMap);
					count = 0;
				} else {
					i++;
				}
			}
		}

		System.out.println("MinLength: " + minLength);
		System.out.println("PrevLength: " + prevLength);

	}

	private static boolean targetContains(Map<Character, Integer> charmap, char charAt) {
		if (charmap.containsKey(charAt) && charmap.get(charAt) > 0) {
			charmap.put(charAt, charmap.get(charAt) - 1);
			return true;
		}
		return false;
	}

}
